import React from 'react';
import { Consumer } from './Context';

const Gif = () => (
  <Consumer>
  { context => {
    return (
      <li className="gif-wrap" title={gif.title}>
        <a href={gif.bitly_url} target="_blank" rel="noopener noreferrer">
          <img src={gif.images.fixed_height.url} alt={gif.title} />
        </a>
      </li>
    )
  }}
  </Consumer>


);

export default Gif;
